import React from "react";
import styled from "styled-components";
import Logo from "../Logo/Logo";

export const Container = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: space-between;
`;

const Menu = () => {
  return (
    <Container>
      <Logo />
    </Container>
  );
};

export default Menu;
